resources.description:
All Alpaca Customers can access various kinds of market data in [Polygon](https://polygon.io/) using the Alpaca Trade API key ID (but the secret key is not required). For the RESTful interface, you need to give the `apiKey` parameter with the same API key ID, as demonstrated below.

You can query quotes, bars, and fundamentals data for both historical and real-time.

### Example Response
```
{
  "market": "open",
  "serverTime": "2018-07-19T08:51:07-04:00",
  "exchanges": {
    "nyse": "open",
    "nasdaq": "open",
    "otc": "extended-hours"
  },
  "currencies": {
    "fx": "open",
    "crypto": "open"
  }
}
```
